type MinDepth = (root: TreeNode) => number;

export const minDepth: MinDepth = (root) => {
  if (!root) {
    return 0;
  }
  const q = [root];
  let depth = 1;
  while (q.length > 0) {
    const size = q.length;
    /* \u5C06\u5F53\u524D\u961F\u5217\u4E2D\u7684\u6240\u6709\u8282\u70B9\u5411\u56DB\u5468\u6269\u6563 */
    for (let i = 0; i < size; i++) {
      const cur: any = q.shift();
      /* \u5224\u65AD\u662F\u5426\u5230\u8FBE\u7EC8\u70B9 */
      if (cur.left === null && cur.right === null) {
        return depth;
      }
      /* \u5C06 cur \u7684\u76F8\u90BB\u8282\u70B9\u52A0\u5165\u961F\u5217 */
      if (cur.left !== null) {
        q.push(cur.left);
      }
      if (cur.right !== null) {
        q.push(cur.right);
      }
    }
    /* \u8FD9\u91CC\u589E\u52A0\u6B65\u6570 */
    depth++;
  }
  return depth;
};
